import { TextField,Button } from "@mui/material";
import React from "react";
import './Form.css'


function ToDoList()
{
    return(
        <div style={{paddingTop:'90px'}}>

        <div className='body' >
          <TextField name='Firstname' onChange={(e)=>setUser()} sx={{ m: 1, minWidth: 400 }} placeholder='First name' />
        </div>

        <div className='body'>
          <Button  sx={{ m: 1, minWidth: 400 }}  variant="contained">Submit </Button>
        </div>

        </div>
    )
}

export default ToDoList;
